	  410763,"1",29229,1381,1969,
	  "25 ESP",132.000,NULL,"Primer número de la colección. La edición no respeta el formato comic-book original y por tanto las viñetas están retocadas para adaptarlas a este formato de página llegando a aumentar la paginación de las historias.Datado tradicionalmente en 1969 sin mayor precisión atendiendo al año del depósito legal en diciembre de 2015 Joaquín Alapont estableció en su investigación “La llegada de los Superhéroes Marvel a España” el calendario preciso de lanzamientos de las 8 colecciones Marvel de 1969 siendo la fecha de su mes de lanzamiento julio o agosto de 1969. No ha podido ser datado con mayor precisión debido a que los dos primeros ejemplares de esta colección no fueron entregados en la oficina del depósito legal de Barcelona siendo el primero depositado el número 3.La logoforma de la colección es la misma que la utilizada en la portada de The Avengers #58. Contiene The Avengers (Marvel 1963 series) #1-2.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  410764,"2",29229,1381,1969,
	  "25 ESP",132.000,NULL,"Contiene The Avengers (Marvel 1963 series) #3-4.La edición no respeta el formato comic-book original y por tanto las viñetas están retocadas para adaptarlas a este formato de página llegando a aumentar la paginación de las historias.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  410765,"3",29229,1381,1969,
	  "25 ESP",132.000,NULL,"Contiene The Avengers (1963 series) #5-6.La edición no respeta el formato comic-book original y por tanto las viñetas están retocadas para adaptarlas a este formato de página llegando a aumentar la paginación de las historias.Datado tradicionalmente en 1969 sin mayor precisión atendiendo al año del depósito legal en diciembre de 2015 Joaquín Alapont estableció en su investigación “La llegada de los Superhéroes Marvel a España” el calendario preciso de lanzamientos de las 8 colecciones Marvel de 1969 siendo la fecha de su mes de lanzamiento septiembre de 1969 al ser el primer ejemplar de la colección entregado en la oficina del depósito legal de Barcelona.",
